// SongButton.js
import React from 'react';
import { Link } from 'react-router-dom';
import './songbutton.css'


const SongButton = ({ link, songName }) => {
  const handleClick = async () => {
    try {
      const response = await fetch(`http://localhost:8080/api/data/${encodeURIComponent(songName)}`);
      const data = await response.json();

      // Process and display the data (modify as needed)
      console.log(data.notes);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <button className="song-button" onClick={handleClick}>
      {songName}
    </button>
  );
};

